import React from 'react';
import Airlogo from "./image/Airbnb-Logo.png"
import Airphoto from "./image/src/image/AirBnb Experiences.png"

export default function Navigationbar() {
  return (
    
      <nav>
        <img src={Airlogo}
             alt="airbnblogo"
             className='navlogobnb'/>
      </nav>
    
  );
}
